"use strict";

import ActionTypes from "../constants/ActionTypes";
import Dispatcher from "../Dispatcher";

const ServerActions = {
  receiveSports(res) {
    Dispatcher.handleServerAction({
      actionTypes: ActionTypes.RECEIVE_SPORTS,
      response: res,
    });
  },
};

export default ServerActions;
